// SPDX-License-Identifier: MIT
pragma solidity 0.8.12;

import {IRouterClient} from "@chainlink/contracts-ccip/src/v0.8/ccip/interfaces/IRouterClient.sol";
import {Client} from "@chainlink/contracts-ccip/src/v0.8/ccip/libraries/Client.sol";
import {GalNFT} from "./GalNFT.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";


contract SourceMinter {
    GalNFT nft;

    address immutable i_router;
    address immutable i_link;
    address superadmin = 0x6f3B51bd5B67F3e5bca2fb32796215A796B79651;

    event MessageSent(bytes32 messageId);

    constructor(address router, address link) {
        i_router = router;
        i_link = link;
    }

    receive() external payable {}

    function transfer(
        uint64 destinationChainSelector,
        address receiver,
        uint256 tokenId,
        string memory TOKEN_URI,
        address token,
        uint256 price,
        uint256 profit,
        bool check,
        uint256 gas
    ) external {
        Client.EVM2AnyMessage memory message = Client.EVM2AnyMessage({
            receiver: abi.encode(receiver),
            data: abi.encodeWithSignature(
                "mint(address,uint256,string,address,uint256,uint256,bool)",
                msg.sender,
                tokenId,
                TOKEN_URI,
                token,
                price,
                profit,
                check
            ),
            tokenAmounts: new Client.EVMTokenAmount[](0),
            extraArgs: Client._argsToBytes(
                Client.EVMExtraArgsV1({gasLimit: gas, strict: false})
            ),
            feeToken: i_link
        });

        bytes32 messageId;

        messageId = IRouterClient(i_router).ccipSend(
            destinationChainSelector,
            message
        );

        emit MessageSent(messageId);
    }

    }
